import React from 'react';
import Footer from "~/components/Footer";
import Header from "~/components/Header";
import Announce from "~/components/Announce";

const AnnounceDetail = () => {
  return (
    <div>
      <Header />
      <Announce />
      <Footer />
    </div>
  );
};

export default AnnounceDetail;
